    false,nt"url": null,nt"notes": "This is the plant database for St. Vincent
    National Wildlife Refuge.  The database is a compilation of published lists of plants
    for the refuge as well as site observations made between 1997 and 1999.  The database
    contains 17 fields of information for each of the 596 plant species found on the
    refuge.  These fields include: common name, genus, species, variety or subspecies,
    author citation, family, flowering characteristics, flowering date, life history,
    habitat, life form, origin, habitat description, status in Florida, wetland status,
    if the species is at risk, and the global rank for the species as described by the
    Florida Natural Areas Inventory.",nt"license_title": "License Not Specified",nt"extras":
